import React, {useState, useEffect} from 'react';
import { Modal } from 'antd'


const NewSession = ({isVisible}) => {
    const [visible, setVisible] = useState(false)

    return ( 
        <div >
            <Modal visible={isVisible} footer={null}>
                <p>
                    Some contents
                </p>
            </Modal>
        </div>
     );
}

export default NewSession;
